import React from 'react';
import './App.css';
import Navbar from './Components/Navbar'
import SubModal from './Components/SubModal'
import CarouselCenter from './Components/CarouselCenter'

function App() {
  return (
    <div className="App">
      <Navbar/>
      <SubModal/>
      <CarouselCenter />
    </div>
  );
}

export default App;
